import React from 'react'
import {HeaderContainer, PokemonLogo, HeaderButton, Pokeball, ImagesContainer} from './styled'
import pokemonLogo from '../../assets/images/pokemonLogo.png'
import pokeball from '../../assets/images/pokeball.svg'
import { useHistory } from 'react-router-dom'
import {goToPokedex} from '../../routes/coordinator'

const Header = ({title,HeaderButtonToExchange}) => {

    switch (title) {
        case "Lista de Pokémons":
            return "Pokédex";
        case "Pokédex":
            return "Pokémons";
        default:
            break;
    }

    const history = useHistory()
    return(
        <HeaderContainer>
            <ImagesContainer>
                < PokemonLogo src={pokemonLogo}/>
                < Pokeball src={pokeball}/>
            </ImagesContainer>
               
            <HeaderButton onClick={()=>goToPokedex(history)}>
               texto do botão
            </HeaderButton>
            
        </HeaderContainer>
    )
}
export default Header
